    public static boolean hasGroupsSizeX(int[] deck) {
        Map<Integer, Integer> tableOfDigits = new HashMap<>();

        if (deck.length == 1){
            return true;
        }

        for (int item : deck) {
            if (tableOfDigits.isEmpty() || !tableOfDigits.containsKey(item)) {
                int count = 0;
                for (int i = 0; i < deck.length; i++) {
                    if (deck[i] == item)
                        count++;
                }
                tableOfDigits.put(item, count);
            }
        }

        List<Integer> list = tableOfDigits.values().stream().toList();
        for (int i = 0; i < list.size() - 1; i++) {
            if (gcd(list.get(i), list.get(i + 1)) == 1) {
                return false;
            }
        }

        return true;
    }

    public static long gcd(long a, long b) {
        return b == 0 ? a : gcd(b, a % b);
    }


